const Button = (props) => {
    return (
        <input type="button" className="button" value={props.text} />
    )
}

const SideMenu = (props) => {
    let operations = props.operations.split(',');
    let buttons = operations.map(operation => {
        return <Button text={operation} />;
    });

    return (
        <div className="side-menu">
            {buttons}
        </div>
    );
}

export default Button;
